import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
	padding: 8px;
	background-color: red;
	width: 100%;
	max-height: 100%;
	margin: 0 auto;
`;

const Register = () => {
	return;
	<Container></Container>;
};

export default Register;
